import ButtonGroup from "react-bootstrap/ButtonGroup";
import Dropdown from "react-bootstrap/Dropdown";
import { Form } from "react-bootstrap";
import { useState } from "react";

function DropDownMark({props}) {
  
    const [mark, setMark]=useState()

    return (
    <Dropdown as={ButtonGroup}>
      <Form.Control type="text" placeholder={props} disabled />

      <Dropdown.Toggle split variant="dark" id="dropdown-split-basic" />

      <Dropdown.Menu>
        <Dropdown.Item>1</Dropdown.Item>
        <Dropdown.Item>2</Dropdown.Item>
        <Dropdown.Item>3</Dropdown.Item>
        <Dropdown.Item>4</Dropdown.Item>
        <Dropdown.Item>5</Dropdown.Item>
        <Dropdown.Item>6</Dropdown.Item>
        <Dropdown.Item>7</Dropdown.Item>
        <Dropdown.Item>8</Dropdown.Item>
        <Dropdown.Item>9</Dropdown.Item>
        <Dropdown.Item>10</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );
}

export default DropDownMark;
